import {useState, useEffect} from 'react';
import { Swiper, SwiperSlide } from 'swiper/react';

function Sub(){
    return(
        <section className="Sub">
            <div className="subVisual">
                <h1>서브페이지</h1>
            </div>
            <div className="subTabWrap">
                <div className="subTab">Sub tab1</div>
                <div className="subTab">Sub tab2</div>
                <div className="subTab">Sub tab3</div>
            </div>
        </section>
    )
}
export{Sub}
